R.M. Khobragade and P.P. Dixit A.M. Deshmukh, &quot;Handbook of Biofertilizers and Biopesticides&quot;
English | 2007 | ISBN: 8189473158 | 336 pages | PDF | 15,5 MB

Handbook of Biofertilizers and Biopesticides is a collection of research papers presented in the national conference on &quot;Frontiers in biofertilizers and biopesticides&quot; The research papers of scientists from all over India and few from abroad are included in the book. The papers furnish recent information on interactions of microorganisms with plant and pests as well as role of microorganisms in increasing soil fertility and plant protection. The book is highly useful to the research workers and experts in the agricultural and environmental field.
